import { useEffect, useState } from 'react';
import './App.css';

import Table from './Components/Table';

function App() {

  const modelIds = ['model1', 'model2', 'model3', 'model4', 'model5'];
  // Fetch data from backend when the component mounts
  const [data, setData] = useState([]);

  useEffect(() => {
    // API call to fetch data from backend
    fetch("http://localhost:8082/data")
      .then((response) => response.json())
      .then((responseData) => {
        console.log("Fetched data:", responseData); // Log the fetched data
        // Check if responseData contains the expected 'data' property and if it's an array
        if (responseData && Array.isArray(responseData.data)) {
          setData(responseData.data);
        } else {
          console.error("Error: Fetched data is not in the expected format.");
        }
      })
      .catch((error) => console.error("Error fetching data:", error));
  }, []);
  return (

    <Table modelIds={modelIds} data={data}/>
     );
}

export default App;
